import React from 'react'
import {
    View,
    Text,
    StyleSheet,
    TextInput,
    Platform,
    Button,
    StatusBar,
    Image,
    TouchableOpacity,
} from 'react-native'
import Feather from 'react-native-vector-icons/Feather'
import * as Animatable from 'react-native-animatable'
import { LinearGradient } from 'expo-linear-gradient'
import MaterialIcons from 'react-native-vector-icons/MaterialIcons'



const SignUp = () => {
    
    
    return (
        <View>
            <Text style={styles.header}>hello</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#20b2aa',
    },
    header: {
        flex: 1,
        justifyContent: 'flex-end',
        paddingHorizontal: 20,
        paddingBottom: 50
    },
    footer: {
        flex: 3,
        backgroundColor: '#f8f8ff',
        borderTopLeftRadius: 30,
        borderTopRightRadius: 30,
        paddingHorizontal: 20,
        paddingVertical: 30
    },
    text_header: {
        color: '#fff',
        fontWeight: 'bold',
        fontSize: 30,
        textAlign: 'center',
    },
    text_footer: {
        fontSize: 25,
        color: '#20b2aa',
        paddingHorizontal: 20,
        fontWeight: 'bold'
    },
    text_footer2: {
        fontSize: 15,
        paddingHorizontal: 20,
        paddingBottom: 10,
        color: '#778899',
    },
    text_footer3: {
        fontSize: 15,
        paddingHorizontal: 20,
        color: '#778899',
        paddingTop: 20
    },
    textInput: {
        flex: 1,
        color: '#000000',
        borderBottomColor: '#66cdaa',
        borderBottomWidth: 2,
    },
    action: {
        flexDirection: 'row',
        paddingHorizontal: 20,
        paddingTop: 10
    },
    button: {
        alignItems: 'center',
        marginTop: 50,
        paddingBottom: 10,
    },
    signUp: {
        width: '80%',
        height: 50,
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 30,
    },
    textSignUp: {
        fontSize: 15,
        fontWeight: 'bold',
    },

})


export default SignUp
